import {useState} from "react";

const Example = () => {

  const todosList = [{
    id: 1,
    content: "店予約する",
  },
  {
    id: 2,
    content: "卵買う",
  },
  {
    id: 3,
    content: "郵便出す",
  },
];
  return (
    <>
      <h3>完成系と同じような機能を作成してください。</h3>
      <p>また、枠線で囲まれた部品をコンポーネントに分離してください。</p>
      <h2>Reminder</h2>
      {
      todosList.map((content)=>{
        return(
          <>
          <label key ={content}></label>
          <button 
            
          >完了</button>
          <div>{content}</div>
          </>
          )
      })
      
      }
      <button >完了</button>
      {/* <button onClick = {countUp}>+</button> */}
    </>
  );
};

export default Example;
